import React , {useState} from 'react'

function Todo(props){
    const [text,setText] = useState(props.text);
    const [state,setState] = useState(props.state);
    const todos = [{
        text: 'homeworks',
        state : true
    }]
    todos.push({
        text : 'make a dinner',
        status : true
    })
    console.log(todos);
    return(
        <div>
            <p>{text}</p>
            <button onClick = { () => setState(!state)}> {state ? 'Active' : 'Done'} </button>
        </div>
    )

}

export default Todo
